import React, {useState} from "react";

const Search = () => {
    const [value, setValue] = useState("");
    return (
        <>
            <h1>Search Component</h1>
            <form className="ui form">
                <input 
                type="text" 
                placeholder="Search wikipedia.. ." 
                value={value} 
                onChange={(e) => setValue(e.target.value)}
                />
            </form>
        </>
    );
}

export default Search;
